import React, { useState } from "react";
import "./Rentals.css";
import { Link } from "react-router-dom";
import { useLocation } from "react-router";
import logo from "../images/CarEth-white.png";
import { Button, ConnectButton, Icon } from "web3uikit";
import RentalsMap from "../components/RentalsMap";

const Rentals = () => {
  const { state: searchFilters } = useLocation();
  const [highLight, setHighLight] = useState();
  const rentalsList = [
    {
      attributes: {
        city: "New York",
        unoDescription: "5 Seats • 4 Doors • All-wheel drive",
        dosDescription: "360 degree camera • Automatic transmission • Electric",
        imgUrl:
          "https://ipfs.io/ipfs/bafkreiedmxywrmqupsdymsuxqoem24cdzgcnwocikyhg5spvhzjrgehpbq/",
        lat: "40.716862",
        long: "-73.999005",
        name: "Tesla Model 3",
        pricePerDay: "0.02",
      },
    },
  ];
  let cords = [];
  rentalsList.forEach((e, i) => {
    cords.push({ lat: e.attributes.lat, lng: e.attributes.long});
  });
  return (
    <>
     <div className="topBanner">
       <div>
         <Link to="/">
           <img className="logo" src={logo} alt="logo"></img>
         </Link>
        </div>
        <div className="searchReminder">
          <div className="filter">{searchFilters.location}</div>
          <div className="vl" />
          <div className="filter">
          {`
           ${searchFilters.pickUpDate.toLocaleString("default", {
             month: "short",
           })} 
           ${searchFilters.pickUpDate.toLocaleString("default", {
             day: "2-digit",
           })} 
           - 
           ${searchFilters.returnDate.toLocaleString("default", {
             month: "short",
           })} 
           ${searchFilters.returnDate.toLocaleString("default", {
             day: "2-digit",
           })}
          `}
          </div>
          <div className="vl" />
          <div className="filter">{searchFilters.cartype} Car</div>
          <div className="searchFiltersIcon">
            <Icon fill="#ffffff" size={20} svg="search" />
          </div>
        </div>
        <div className="lrContainers">
         <ConnectButton />
        </div>
     </div>
     <hr className="line" />
     <div className="rentalsContent">
       <div className="rentalsContentL">
         Available For Your Location
         {rentalsList &&
         rentalsList.map((e) => {
           return(
             <>
                <hr className="line2" />
                <div className={highlight==i?"rentalDivH":"rentalDiv"}>
                  <img className="rentalImg" src={e.attributes.imgUrl}></img>
                  <div className="rentalInfo">
                    <div className="rentalTitle">{e.attributes.name}</div>
                    <div className="rentalDesc">
                      {e.attributes.unoDescription}
                    </div>
                    <div className="rentalDesc">
                      {e.attributes.dosDescription}
                    </div>
                    <div className="bottomButton">
                      <Button
                        text="Pickup This Car"
                      />
                      <div className="price">
                        <Icon fill="#808080" size={10} svg="eth" /> {e.attributes.pricePerDay} / Day
                      </div>
                    </div>
                  </div>
                </div>
             </>
           )
          })
          }
       </div>
       <div className="rentalsContentR">
         <RentalsMap locations={cords} setHighLight={setHighLight}/>
       </div>
     </div>


    </>
  );
};

export default Rentals;
